SELECT DISTINCT aspace_data.uri
	, ANY_VALUE(aspace_data.call_number) as call_number
	, ANY_VALUE(aspace_data.resource_title) as collection_title
	, ANY_VALUE(aspace_data.ao_title) as ao_title
	, ANY_VALUE(aspace_data.collection_id)
	, GROUP_CONCAT(DISTINCT aspace_data.digital_object_id SEPARATOR '; ')
#	, aspace_data.file_uri
#	, aspace_data.dig_contents
	, GROUP_CONCAT(DISTINCT du.coverage_from)
	, GROUP_CONCAT(DISTINCT du.coverage_to)
	, GROUP_CONCAT(DISTINCT SUBSTRING_INDEX(df2.filemoddate, ' ', 1) SEPARATOR '; ') as mod_dates
	, GROUP_CONCAT(DISTINCT df2.id SEPARATOR '; ') as df_id
#	, aspace_data.dob_create_time
FROM
(SELECT CONCAT('/repositories/12/archival_objects/', archivesspace.ao.id) as uri
	, replace(replace(replace(replace(replace(archivesspace.resource.identifier, ',', ''), '"', ''), ']', ''), '[', ''), 'null', '') AS call_number
	, replace(archivesspace.resource.title, '"', "'") as resource_title
	, archivesspace.ao.display_string as ao_title
	, archivesspace.pres_notes.collection_id as collection_id
	, archivesspace.dob.digital_object_id
	, archivesspace.dob.create_time as dob_create_time
	, archivesspace.fv.file_uri
	, replace(fv.file_uri, 'https://preservica.library.yale.edu/api/entity/digitalFileContents/', '') as dig_contents
FROM archivesspace.archival_object ao
JOIN archivesspace.resource on archivesspace.resource.id = archivesspace.ao.root_record_id
LEFT JOIN (SELECT archivesspace.note.archival_object_id as ao_id
				, replace(JSON_UNQUOTE(JSON_EXTRACT(CAST(CONVERT(archivesspace.note.notes using utf8) as json), '$.subnotes[0].content')), 
					'https://preservica.library.yale.edu/explorer/explorer.html#prop:4&',
					'') as collection_id
			FROM archivesspace.note
			WHERE archivesspace.note.notes like '%preservica%'
			AND archivesspace.note.notes like '%otherfindaid%') as pres_notes on pres_notes.ao_id = ao.id
JOIN archivesspace.instance on archivesspace.instance.archival_object_id = ao.id
JOIN archivesspace.instance_do_link_rlshp idlr on idlr.instance_id = archivesspace.instance.id
LEFT JOIN archivesspace.digital_object dob on dob.id = idlr.digital_object_id
JOIN archivesspace.file_version fv on fv.digital_object_id = dob.id
WHERE dob.digital_object_id not like '%aviary%'
AND ao.id in
